INSERT INTO `speakers_speaker` VALUES (1,'Daniel Ramamoorthy','Startup Coach',NULL,'static/uploads/speakers/Daniel Ramamoorthy.jpg','eight@nitrr.ac.in','','An eclectic person who is a box of wonder, excelling the entrepreneurial domain: from being an entrepreneur and a motivational speaker, coaching others to being a world famous host and speaker!',2018,'https://www.linkedin.com/in/iamdanram/',1,'2019-07-26 12:33:41.945407','2019-07-26 13:13:41.690866'),(2,'Kumar Gaurav','Founder Cashaa',NULL,'static/uploads/speakers/Kumar Gaurav.jpg','nine@nitrr.ac.in','','Honored with an extraordinary status by the US government, holding a place in 100 influential people in the world of blockchain, Mr Kumar Gaurav, Founder of Cashaa has set the bar high and stood out of the crowd.',2018,'https://www.linkedin.com/in/kgauravitc',1,'2019-07-26 12:33:46.417348','2019-07-26 13:13:41.908903'),(3,'Nandini Vaidyanathan','CARMa CONNECT',NULL,'static/uploads/speakers/Nandini Vaidyanathan.jpg','ten@nitrr.ac.in','','An academician turned entrepreneurial mentor, founder of CARMa CONNECT, this visionary lady has created an eco-system to nourish the spirit of entrepreneurship.',2018,'https://www.linkedin.com/in/nandinivaidyanathan',1,'2019-07-26 12:33:49.340917','2019-07-26 13:13:42.036401'),(4,'Dr Gopichand Katragadda','Chief Technology Officer at Tata Sons',NULL,'static/uploads/speakers/Dr Gopichand Katragadda.jpg','eleven@nitrr.ac.in','','Dr Gopichand Katragadda is the group chief technology officer at Tata Sons. In this role, Dr Katragadda drives technology and innovation for the Tata group leveraging cross-company synergies. He also serves as a director on the boards of select Tata companies.',2018,'https://in.linkedin.com/in/gopichand-katragadda-2b1a0b7',1,'2019-07-26 12:33:51.485742','2019-07-26 13:13:42.175042'),(5,'Rishabh Dev','Managing Director at Mapplinks and Mapplinks Academy',NULL,'static/uploads/speakers/Rishabh Dev.jpg','four@nitrr.ac.in','','ES17 had Mr. Rishabh Dev  The Growth Hacking Bogeyman, a serial entrepreneur, presently the director of Mapplinks, India, who regularly enlightens enthusiasts with growth hacking and digital marketing. Not only growth hacking, but also many diverse fields intrigued him. His approach towards finding the optimal solutions for his clients is commendable.',2017,'https://www.linkedin.com/in/rishabhdev/',1,'2019-07-26 12:33:55.502522','2019-07-28 12:03:03.377122'),(6,'Abi Aryan','The London School of Economics and Political Science (LSE)',NULL,'static/uploads/speakers/Abi Aryan.jpg','three@nitrr.ac.in','','Ms. Abi, a perfect instance of beauty with brains, graduated from London School of Economics and Political Science and has a deep interest in AI and Blockchain. She has worked as a strategist with AI companies globally and is the founder of Delegano and Director at Women Who Code, Delhi. Having a great experience as TED speaker, Abi also worked on Augmented Reality and Bit coin / Block chain companies in U.K.',2017,'https://www.linkedin.com/in/abi-aryan-168131112/',1,'2019-07-26 12:33:59.629016','2019-07-28 12:03:21.460646'),(7,'Rahul Tyagi','Vice President - Training at Lucideus',NULL,'static/uploads/speakers/Rahul Tyagi.jpg','five@nitrr.ac.in','','Rahul being a perfect combination of intelligence and dedication, at present is the co- founder of Lucideus. Handling the toughest of the cyberspace issues with a magical ease is what makes Rahul stand out from the rest and also he speaks regularly at prestigious platforms like Exhibition India group, IPPAI, DCD convergence, Security Watch India, Micro Finance in Asia.  Recently, he has been honored with Fortune India\'s 40 under40 2018.',2017,'https://www.linkedin.com/in/iamrahultyagi/',1,'2019-07-26 12:34:01.717905','2019-07-28 12:03:31.342882'),(8,'Mr. Saransh Roy','Associate at Invest India',NULL,'static/uploads/speakers/Mr. Saransh Roy.jpg','saranshroy@gmail.com','','Mr. Roy is an associate at Invest India, Startup India Hub. Saransh being a versatile individual, addresses people on the need to empower the countrys economy by creating jobs rather than seeking one and the governmental policies guarding startup related agendas.  Apart from this, he has an expertise in dealing with Intellectual Property Rights, including issues like credit guarantee, tax exemption laws and others.',2017,'https://www.linkedin.com/in/saransh-roy-01b966a2/',1,'2019-07-26 12:34:03.458521','2019-07-28 12:03:41.889792'),(9,'Harjeet Khanduja','Vice President Human Resource at Reliance JIO Infocomm',NULL,'static/uploads/speakers/Harjeet Khanduja.jpg','three@nitrr.ac.in','','Currently, Mr. Harjeet is the Vice President Human Resources at Reliance Jio. He has smartly led various HR projects in India, Canada as well as U.S.A. for various market giants like Reliance, Tata, Piramal, just to name a few. With a vivacious personality, Harjeet has not only led HR, but also been a blogger, poet and an international speaker, addressing people on the practicalities of dealing with the pre and post startup essentials.  We at E-Summit 2017 witnessed this great, humorous and intellectual person.',2017,'https://www.linkedin.com/in/harjeetkhanduja/',1,'2019-07-26 12:34:08.219708','2019-07-28 12:04:01.641743'),(10,'Anil Joshi','Managing Partner, Unicorn India Ventures',NULL,'static/uploads/speakers/Anil Joshi.jpg','two@ecell.nitrr.ac.in','','Anil Joshi is the Managing Partner at Unicorn India Ventures, a SEBI approved venture fund under AIF-I Category. The man with his vision has helped in closing approximately 60 start-up deals with over INR 100 crs investments and has served on the Board of five companies and is involved with various incubation centers as a mentor in India and outside India.',2016,'https://www.linkedin.com/in/aniljoshi74/',1,'2019-07-26 12:34:11.297937','2019-07-28 12:04:24.522020'),(11,'Ravi Ranjan','NASSCOM 10000 Startups',NULL,'static/uploads/speakers/Ravi Ranjan.jpg','one@hello.com','','Ravi Ranjan is the head of Nasscom, 10000 startups, Kolkata. He is one of those Indians who has played an influential role in giving the ground to many startups. It is aimed at incubating, funding and supporting 10,000 technology start-ups in India over the next ten years. The person with an inventive bend for entrepreneurship is the person who has taken to himself to bring the best startups in Indian market.',2016,'https://www.linkedin.com/in/raviranjan2/',1,'2019-07-26 12:34:15.864983','2019-07-28 12:04:34.846124'),(12,'Aditi Chourasia','Co-Founder and CEO EngineerBabu',NULL,'static/uploads/speakers/Aditi Chourasia.jpg','hello@ebabu.com','','The lady with the spirit of a real entrepreneur has always aimed to scale new heights. The co-founder of Engineer Babu, she has always preached that startup doesnt mean money and there should be a good idea and passion to accomplish your task. She is a true inspiration and a symbol of women empowerment.',2016,'https://www.linkedin.com/in/aditichaurasia/',1,'2019-07-26 12:34:18.400453','2019-07-28 12:04:52.475250'),(13,'Anup Kalbalia','Tech Lead at Directi',NULL,'static/uploads/speakers/Anup Kalbalia.jpg','anup.kalbalia@gmail.com','','The tech geek with an experience of working in various programming languages like Delphi, C and Java, has built enterprise applications using different technologies like TCP sockets, HTTP, Restful Web Services etc. Being the Tech Lead at Directi, he has always visioned to create a pool of budding entrepreneurs who can make a difference to society.',2016,'https://www.linkedin.com/in/anupkalbalia/',1,'2019-07-26 12:34:21.943703','2019-07-28 12:05:00.687681'),(14,'Kumaran Brothers','AppGodimensions',NULL,'static/uploads/speakers/Kumaran Brothers.jpg','apps.godimensions@gmail.com','','Hailing from Chennai, two brothers Shravan Kumaran(12) and Sanjay Kumaran(10) went onto become the youngest Indian entrepreneurs as well as CEO of GoDimensions in 2012.\r\nBrothers have developed a number of mobile applications for android as well as iOS and aim that within a few years about 50% of the apps in the market should be owned by them. They also created VR based headsets called GoVR. The brothers were a part of E- Summit 2015 and since then, they are unstoppable.',2015,'https://twitter.com/AppGodimensions',1,'2019-07-26 12:34:25.974852','2019-07-28 12:05:25.248459'),(15,'Prateek Sethi','Communication Designer and Creative Director at Trip Creative Services',NULL,'static/uploads/speakers/Prateek Sethi.jpg','prateek@wearetrip.in','','Prateek has been the Communication Designer and Creative Director at Trip Creative Services, since 2009. Graduated from National Institute of Design, Ahmedabad, he has worked on animation and effects for various leading television channels and shows. He is a very creative person with an imaginative approach towards his projects and also is a talented speaker.',2015,'https://www.facebook.com/prateeksethi',1,'2019-07-26 12:34:28.636652','2019-07-28 12:05:40.586957');
